import React from 'react';
import { useRef } from 'react';

export default function Login() {
    const usernameRef = useRef();

    return (
        <div>
            <h1>Sign in</h1>

            <form>
                <label htmlFor='username'>Username:</label>
                <input
                    type="text"
                    autoComplete='off'
                    ref={usernameRef}
                    id="username"
                    required
                />

                <label htmlFor='password'>Password:</label>
            </form>
        </div>
    )
}
